void find::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"val_r_TDATA\" :  \"" << val_r_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"val_r_TVALID\" :  \"" << val_r_TVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"val_r_TREADY\" :  \"" << val_r_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_vec_TDATA\" :  \"" << in_vec_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_vec_TVALID\" :  \"" << in_vec_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_vec_TREADY\" :  \"" << in_vec_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_vec_TLAST\" :  \"" << in_vec_TLAST.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_vec_TDATA\" :  \"" << out_vec_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_vec_TVALID\" :  \"" << out_vec_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"out_vec_TREADY\" :  \"" << out_vec_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_vec_TLAST\" :  \"" << out_vec_TLAST.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

